import React from 'react';
import './Footer.css';
import '@fortawesome/react-fontawesome';

function Footer({}) {
    return (
        <footer className="App-footer">
          <div className="social-links">
            <p className="footer-text">Check out my Github and Linked In!</p>
            <a 
              // className="btn btn-github btn-dark"
              href="https://github.com/humkeyg"
              target="_blank"
            > 
            </a>
              <FontAwesomeIcon icon={faGithub} />
            <a
              // className="btn btn-linkedin btn-primary"
              href="https://www.linkedin.com/in/gabrielle-humkey-b74729217/"
              target="_blank"
            >
              <FontAwesomeIcon icon={faLinkedinIn} />
            </a>
          </div>
        </footer>
    )
};

export default Footer;
